INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11100, 12426, 'r.bitsa', null, null, 'Перенесення оплат з видалених договорів на діючі. В зв''язку з тим, що один і той самий договір міг передаватися декілька разів - виникали ситуації, коли оплати залишались на видалених договорах. Зараз можливість завантаження декількох договорів з одним ідентифікатором заборонена.', '2014-10-23 16:10:41', 'r.bitsa', '2014-10-23 16:10:41', '2014-10-23 16:05:00', 5400);
INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11101, 12426, 'r.bitsa', null, null, 'Запит від Ковбель Лариси. Питання пов''язане з принципами створення задач користувачам при відправленні на валідацію пере розподілів оплат та дефолтних розподілів.', '2014-10-23 16:13:19', 'r.bitsa', '2014-10-23 16:13:19', '2014-10-23 16:11:00', 1800);
INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11102, 12426, 'r.bitsa', null, null, 'Проблеми роботи з веб-сервером АВАРД kvsa33. Двічі протягом дня навантаження на процесор сервера складало 99%. Це спричиняло ряд проблем при роботі веб-сервісів. Так спостерігались проблеми в галактиці при формуванні договору, та при передачі оплат з 1С7 в комісійну систему. Питання поки що вирішили шляхом перезавантаження самого веб-серверу. Якщо така ситуація повториться ще - потрібно буде перезавантажити сервер kvsa16.', '2014-10-23 16:19:10', 'r.bitsa', '2014-10-23 16:19:10', '2014-10-23 16:13:00', 5400);
INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11103, 12426, 'r.bitsa', null, null, 'Налаштування окремої ролі для Вікторії Гіренко.', '2014-10-23 16:22:30', 'r.bitsa', '2014-10-23 16:22:30', '2014-10-23 16:22:00', 3600);
INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11104, 12426, 'r.bitsa', null, null, 'Звернення від Смолій Діани. Користувач запитував по яким принципам відбувається зміна статусу ПП на "Архівна". По даному питанню проведено аналіз, та надано відповідь.', '2014-10-23 16:24:33', 'r.bitsa', '2014-10-23 16:24:33', '2014-10-23 16:22:00', 1800);
INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11105, 12426, 'r.bitsa', null, null, 'Звернення Белецької Людмили. По ряду розподілів оплат ну було заповнено суму АВР на сторнуючому платежі. Виправлено.', '2014-10-23 16:33:36', 'r.bitsa', '2014-10-23 16:33:36', '2014-10-23 16:31:00', 1800);
