INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11127, 12426, 'r.bitsa', null, null, 'Були проблеми з проведенням документів АВАРД по яким включено замір продуктивності. Після проведення аналізу було зроблено висновок, що замір продуктивності потрібно включати на менш ніж на тиждень. Максимум на 2-3 дні. В противному випадку, в регістрі накопичується велика кількість інформації.', '2014-10-24 16:11:24', 'r.bitsa', '2014-10-24 16:11:24', '2014-10-24 16:01:00', 3600);
INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11128, 11382, 'y.yashunin', null, null, '', '2014-10-24 16:19:42', 'y.yashunin', '2014-10-24 16:19:42', '2014-10-24 16:19:00', 7200);
INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11129, 12426, 'r.bitsa', null, null, 'Проблеми з веб-сервером kvsa33. Вчора ввечері, було перезавантажено сервера kvsa16 та kvsa33. Але це не дало результату. Сьогодні виникали ті ж самі проблеми, що і минулого разу. Після більш детального аналізу помилок було виявлено, що на стороні АВАРД, при певних умовах, можливе зациклення рекурсивної функції під час завантаження статусів по договорам страхування. Ця помилка буде виправлена в суботу (25.10)', '2014-10-24 16:25:43', 'r.bitsa', '2014-10-24 16:25:43', '2014-10-24 16:20:00', 14400);
INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11130, 12426, 'r.bitsa', null, null, 'Звернення від користувача Ахмад Оксана. АВР було передано в 1С8, але  його там немає. Було проведено аналіз логів на мулі. Єдиний можливий варіант - це зв''язано з проблемами в роботі 1С8, коли вона була не доступною певний період часу. Даний АВР завантажився, а після відновлення бекапу - затерся.', '2014-10-24 16:40:34', 'r.bitsa', '2014-10-24 16:40:34', '2014-10-24 16:25:00', 3600);
INSERT INTO jira.worklog (ID, issueid, AUTHOR, grouplevel, rolelevel, worklogbody, CREATED, UPDATEAUTHOR, UPDATED, STARTDATE, timeworked) VALUES (11131, 12070, 'r.bitsa', null, null, 'Доопрацювання обробки.', '2014-10-24 16:48:01', 'r.bitsa', '2014-10-24 16:48:01', '2014-10-24 16:47:00', 3600);
