Причина :
Эти разнесения делал Я под правами СуперАдмина, исключающими выгрузку платежей (чтобы не перевыгружать повторно). 
И именно это не было учтено.
90% платежей это Курсовая разница, которая запускалась от моего имени фоновым заданием.
10% платежей относятся к мультиразнесению, которое я сформировал во время тестирований проблем с мультиразнесением.
Контроль синхронизации есть, если разнесения были поставлены для выгрузки, но с этими получилась проблема из-за настроек прав «СуперАдмина» и разнесения просто не поставились для выгрузки, соответственно считалось, что и не должны  были выгружаться.
Поэтому контроль не срабатывал…
В будущем такое не должно повториться - курсовую разницу убрал с фоновых заданий и ее будет формировать отдел разнесения, права суперадмина изменил, и сам более не планирую формировать данные.
